// And groups predicates with the AND operator between them.
func And(predicates ...predicate.RoutingChain) predicate.RoutingChain {
	return predicate.RoutingChain(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.RoutingChain) predicate.RoutingChain {
	return predicate.RoutingChain(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.RoutingChain) predicate.RoutingChain {
	return predicate.RoutingChain(sql.NotPredicates(p))
}
